import React from 'react'
import classes from '.Person.css'

const person = (props) => {

    return( 
        <div className = {classes.Person }>
            <p>I'm {props.name} and I am {props.age} years old! </p>
            <input type="text" onChange={props.changed}/>
        </div>
 )    
};

export default person;
